import React from 'react';
import './App.css';
import Header from './components/Header';
import AddPet from './components/addPet';
import { BrowserRouter as Router, Route, Routes,Link } from "react-router-dom";  // Correct import from react-router-dom
import AllPets from './components/allPets';
import SessionCheck from './components/sessionChack';
import UserPets from './components/userPetList';
import Login from './components/login';
import Profile from './components/profile';
import Chatbot from './components/chatbot';
import AddEmployee from './components/AddEmployee';
import Dashboard from "./components/Dashboard";

function App() {
  return (
    
    <Router>  
      <Header />
      <SessionCheck/>
      <Chatbot/>
      <AddEmployee/>
      <Dashboard/>
      <div className="navbar-nav">
              <Link className="nav-link" to="/">Employee Management</Link>
              <Link className="nav-link" to="/dashboard">Dashboard</Link>
            </div>
      
      <Routes>
        <Route path="/pet/add" element={<AddPet />} />
        <Route path="/pet" element={<AllPets />}/>
        <Route path="/pet" element={<UserPets />}/>
        <Route path="/login" element={<Login />}/>
        <Route path="/profile" element={<Profile />}/>
        <Route path="/employee" element={<AddEmployee/>}>
        <Route path="/dashboard" element={<Dashboard />} />
        </Route>

      </Routes>
    </Router>
  );
}

export default App;
